import React from 'react';

function Home() {

    const handleLogout = () => {
        window.open("http://localhost:3001/auth/logout","_self");
    }

    return (
         <center>
            <h1>Welcome to Home Page!</h1>
            <div style={{ position: 'absolute', top: '20px', right: '20px' }}>
                <button onClick={handleLogout}>Logout</button>
            </div>
         </center>
    );
}

export default Home;
